    const headers = Object.keys(data.total[date]?.discussionsTypes || {}).sort((a, b) => (data.total[date]?.discussionsTypes?.[b]?.received?.total || 0) -
        (data.total[date]?.discussionsTypes?.[a]?.received?.total || 0));
